import React from 'react'
import {View, StyleSheet, Text} from 'react-native'

 export default function Header({ name }){
    return(
        <View style={styles.container}>
            <Text>oi</Text>
        </View>
    )
}

 const styles = StyleSheet.create({
    container:{
        backgroundColor: "#b7b7b7",
        width: "100%",
    }
})
